import React from 'react';
import { Link } from 'react-router-dom';
import UserService from '../service/UserService';
import './Navbar.css';  // Import CSS for styling

function Navbar() {
    const isAuthenticated = UserService.isAuthenticated();
    const isAdmin = UserService.isAdmin();

    const handleLogout = () => {
        const confirmDelete = window.confirm('Are you sure you want to logout?');
        if (confirmDelete) {
            UserService.logout();
        }
    };

    return (
        <nav className="navbar">
            <ul className="nav-links">
                {!isAuthenticated && <li><Link to="/" className="nav-item">Firdous Hassan</Link></li>}
                {isAuthenticated && <li><Link to="/profile" className="nav-item">Profile</Link></li>}
                {isAdmin && <li><Link to="/admin/user-management" className="nav-item">User Management</Link></li>}
                {isAuthenticated && <li><Link to="/" onClick={handleLogout} className="nav-item">Logout</Link></li>}
            </ul>
        </nav>
    );
}

export default Navbar;
